import Home from "./components/Home";
import NavBar from "./components/NavBar";
import SocLinks from "./components/SocLinks";
import PortFol from "./components/PortFol";






function App() {
return (
  <div>
    <NavBar/> 
    <Home/>
    <About/>
    <PortFol/>    

    <SocLinks/>
  </div>
)
}

export default App;
